import React from 'react';

const WelcomeScreen = ({ onStart }) => {
  return (
    <div className="welcome-screen">
      <h1>Welcome to Our Survey page</h1>
      <button onClick={onStart}>Start</button>
    </div>
  );
};

export default WelcomeScreen;
